selector_to_html = {"a[href=\"#delay-3s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">D\u00e9lai 3s<a class=\"headerlink\" href=\"#delay-3s\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#scan-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de scan<a class=\"headerlink\" href=\"#scan-mode\" title=\"Lien vers cette rubrique\">#</a></h1><h2>Mode de d\u00e9clenchement des touches<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Appuyez sur le bouton pour d\u00e9clencher la num\u00e9risation, et rel\u00e2chez le bouton pour terminer la num\u00e9risation. La num\u00e9risation se termine lorsque le scan r\u00e9ussit ou que le temps de lecture d\u00e9passe le temps de lecture unique.</p>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C93.png\"><img alt=\"../../media/3030C93.png\" src=\"../../media/3030C93.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">D\u00e9lai 3s</span><a class=\"headerlink\" href=\"#id6\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../media/2050204.png\"><img alt=\"../../media/2050204.png\" src=\"../../media/2050204.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Mode continu</span><a class=\"headerlink\" href=\"#id2\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../media/2050209.png\"><img alt=\"../../media/2050209.png\" src=\"../../media/2050209.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Mode de d\u00e9tection automatique</span><a class=\"headerlink\" href=\"#id3\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#infinite-delay-disable-same-code-scanning\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">D\u00e9lai infini (D\u00e9sactiver le scan du m\u00eame code)<a class=\"headerlink\" href=\"#infinite-delay-disable-same-code-scanning\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C91.png\"><img alt=\"../../media/3030C91.png\" src=\"../../media/3030C91.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">D\u00e9lai 1s</span><a class=\"headerlink\" href=\"#id5\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C95.png\"><img alt=\"../../media/3030C95.png\" src=\"../../media/3030C95.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">D\u00e9lai 5s</span><a class=\"headerlink\" href=\"#id7\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../media/2050200.png\"><img alt=\"../../media/2050200.png\" src=\"../../media/2050200.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Mode de d\u00e9clenchement des touches</span><a class=\"headerlink\" href=\"#id1\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#no-delay\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Pas de d\u00e9lai<a class=\"headerlink\" href=\"#no-delay\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de d\u00e9clenchement des touches<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Appuyez sur le bouton pour d\u00e9clencher la num\u00e9risation, et rel\u00e2chez le bouton pour terminer la num\u00e9risation. La num\u00e9risation se termine lorsque le scan r\u00e9ussit ou que le temps de lecture d\u00e9passe le temps de lecture unique.</p>", "a[href=\"#same-code-delay-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">R\u00e9glages de d\u00e9lai du m\u00eame code<a class=\"headerlink\" href=\"#same-code-delay-settings\" title=\"Lien vers cette rubrique\">#</a></h2><p>Pour \u00e9viter que le m\u00eame code-barres ne soit scann\u00e9 plusieurs fois en <a class=\"reference internal\" href=\"#continuous-mode\">Mode Continue</a> et en <a class=\"reference internal\" href=\"#auto-sensing-mode\">Mode D\u00e9tection Automatique</a>, vous pouvez demander au scanner d\u2019attendre un d\u00e9lai avant de pouvoir scanner le m\u00eame code-barres.</p>", "a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C99.png\"><img alt=\"../../media/3030C99.png\" src=\"../../media/3030C99.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">D\u00e9lai infini (D\u00e9sactiver le scan du m\u00eame code)</span><a class=\"headerlink\" href=\"#id9\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode continu<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Le scanner fonctionne en continu. Si le scan est r\u00e9ussi ou si le temps de scan d\u00e9passe le temps de travail unique, le scan actuel se termine. Si le temps d\u00e9passe le temps sp\u00e9cifi\u00e9, la prochaine analyse est automatiquement d\u00e9clench\u00e9e.</p>", "a[href=\"#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mode de d\u00e9tection automatique<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Lien vers cette rubrique\">#</a></h2><p>Dans le mode de d\u00e9tection automatique, le scanner d\u00e9tecte la luminosit\u00e9 de l\u2019environnement environnant. Lorsque la luminosit\u00e9 change, le scan est d\u00e9clench\u00e9. Le scan se termine lorsque le scan est r\u00e9ussi ou que le temps de scan d\u00e9passe le temps de travail unique. Peu importe si le dernier scan a \u00e9t\u00e9 r\u00e9ussi ou a \u00e9chou\u00e9, la luminosit\u00e9 de l\u2019environnement environnant sera \u00e0 nouveau d\u00e9tect\u00e9e.</p>", "a[href=\"#delay-7s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">D\u00e9lai 7s<a class=\"headerlink\" href=\"#delay-7s\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#delay-1s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">D\u00e9lai 1s<a class=\"headerlink\" href=\"#delay-1s\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#delay-5s\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">D\u00e9lai 5s<a class=\"headerlink\" href=\"#delay-5s\" title=\"Lien vers cette rubrique\">#</a></h3>", "a[href=\"#id4\"]": "<figure class=\"align-center\" id=\"id4\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C90.png\"><img alt=\"../../media/3030C90.png\" src=\"../../media/3030C90.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Pas de d\u00e9lai</span><a class=\"headerlink\" href=\"#id4\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/3030C97.png\"><img alt=\"../../media/3030C97.png\" src=\"../../media/3030C97.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">D\u00e9lai 7s</span><a class=\"headerlink\" href=\"#id8\" title=\"Lien vers cette image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
